webpackJsonp([59195078208610],{2885:function(n,e){n.exports={pathContext:{docHtml:'<h1>mimic-fn <a href="https://travis-ci.org/sindresorhus/mimic-fn"><img src="https://travis-ci.org/sindresorhus/mimic-fn.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Make a function mimic another one</p>\n</blockquote>\n<p>Useful when you wrap a function in another function and like to preserve the original name and other properties.</p>\n<h2>Install</h2>\n<pre><code>$ npm install --save mimic-fn\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">const mimicFn = require(\'mimic-fn\');\n\nfunction foo() {}\nfoo.unicorn = \'ðŸ¦„\';\n\nfunction wrapper() {\n    return foo() {};\n}\n\nconsole.log(wrapper.name);\n//=> \'wrapper\'\n\nmimicFn(wrapper, foo);\n\nconsole.log(wrapper.name);\n//=> \'foo\'\n\nconsole.log(wrapper.unicorn);\n//=> \'ðŸ¦„\'\n</code></pre>\n<h2>API</h2>\n<p>It will copy over the properties <code>name</code>, <code>length</code>, <code>displayName</code>, and any custom properties you may have set.</p>\n<h3>mimicFn(to, from)</h3>\n<h4>to</h4>\n<p>Type: <code>Function</code></p>\n<p>Mimicking function.</p>\n<h4>from</h4>\n<p>Type: <code>Function</code></p>\n<p>Function to mimic.</p>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/sindresorhus/rename-fn">rename-fn</a> - Rename a function</li>\n</ul>\n<h2>License</h2>\n<p>MIT Â© <a href="https://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/mimic-fn/readme",proj:"argo-ci"}}}});
